import styled from "styled-components";

export const Wrapper = styled.div`
  width: 90%;

  .profile-image {
    width: 90%;
    background: cyan;
  }
`;

export const Image = styled.img`
  /* border: 1px solid var(--lightGrey); */
  border-radius: 20px;
`;

export const Text = styled.div`
  padding: 10px 0;
`;
